(props: CrudViewProps) => {
  const { actions, data, highlight, tsInterface, onEndReached } = props;

  return (
    <Div className="flex flex-row flex-wrap">
      {data?.map((item) => {
        const imageUrl = itemGetBackendAssetUrl({
          item,
          backendAsset: (item as any).pictureImage,
        });
        return imageUrl && typeof imageUrl === "string" ? (
          <SpaceCard
            ctaText="More info"
            imageUrl={imageUrl}
            darkened={false}
            secondaryImageUrl={imageUrl}
            subtitle="Subtitle"
            title="Title"
          />
        ) : (
          "no img url"
        );
      })}
    </Div>
  );
}
